import './styling/App.css';
import Login from './pages/Login'; // Import your Login component
import Lottie from "lottie-react";
import testanimation from "./assets/testanimation.json";
import loginsuccessanimation from './assets/testanimation.json';

import axios from 'axios';
import Navbar from "./components/Navbar";
import Home from "./pages/Home"; // You might need to install axios via npm if you haven't already

function App() {
    let component
    switch (window.location.pathname) {
        case "/":
            component = <Home/>
            break

    }
    return (
        <div>

            <Navbar/>
            {component}
            <Login/>
        </div>
    );


}

export default App;
